import React from 'react';
import StyleCard from './Card.css';

export default function Card({ min, max, name, img, onClose }) {
	// ac치 va tu c칩digo
	return (
		<div>
			<section className={StyleCard.cajapadre}>
				<div className={StyleCard.caja - 1}>
					<span >{name} </span>
					<button onClick={onClose}> X </button>
				</div>

				<div className={StyleCard.caja-2}>
					<span> Min </span>
					<span> {min} </span>
				</div>
				<div className={StyleCard.caja - 3}>
					<span> Max </span>
					<span> {max} </span>
				</div>
				<div className={StyleCard.caja - 4}>
					<img src={img} alt=" " />
				</div>
			</section>
		</div>
	);
}
